static const uint8_t JMBLB[] = {
    11,
    0x1C,0x96,0x3F,0xBE,0xE0,0xE3,0x0F,0x3D,0x57,0xF3,0xC7
};

// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMBLData(char *Buffer)
{
    memcpy(Buffer, &JMBLL0[1], JMBLL0[0] << 2);
    Buffer += (JMBLL0[0] << 2);

    memcpy(Buffer, &JMBLL1[1], JMBLL1[0] << 2);
    Buffer += (JMBLL1[0] << 2);

    memcpy(Buffer, &JMBLL2[1], JMBLL2[0] << 2);
    Buffer += (JMBLL2[0] << 2);

    memcpy(Buffer, &JMBLL3[1], JMBLL3[0] << 2);
    Buffer += (JMBLL3[0] << 2);

    memcpy(Buffer, &JMBLL4[1], JMBLL4[0] << 2);
    Buffer += (JMBLL4[0] << 2);

    memcpy(Buffer, &JMBLB[1], JMBLB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMBLName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMBLData(void)
{
    remove(JMBLName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMBLData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMBLName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMBLName)) return "";
    #endif

    if (!(han = fopen(JMBLName, "wb"))) return "";
    if (AutoClean) atexit(KillJMBLData);

    num = fwrite(&JMBLL0[1], 4, JMBLL0[0], han);
    if (num != JMBLL0[0]) {fclose(han); return "";}

    num = fwrite(&JMBLL1[1], 4, JMBLL1[0], han);
    if (num != JMBLL1[0]) {fclose(han); return "";}

    num = fwrite(&JMBLL2[1], 4, JMBLL2[0], han);
    if (num != JMBLL2[0]) {fclose(han); return "";}

    num = fwrite(&JMBLL3[1], 4, JMBLL3[0], han);
    if (num != JMBLL3[0]) {fclose(han); return "";}

    num = fwrite(&JMBLL4[1], 4, JMBLL4[0], han);
    if (num != JMBLL4[0]) {fclose(han); return "";}

    num = fwrite(&JMBLB[1], 1, JMBLB[0], han);
    if (num != JMBLB[0]) {fclose(han); return "";}

    fclose(han);
    return JMBLName;
}

